import { useEffect } from "react";
import { useState } from "react/cjs/react.production.min";
import classes from "./Products.module.css";

const Products = () => {
  const [data, setData] = useState([]);

  const response = fetch("https://5d76bf96515d1a0014085cf9.mockapi.io/product")
    .then((res) => res.json())
    .then((data) => {
      setData(data);
      return data;
    });

  console.log(setData);

  return <section className={classes.Products}>Products</section>;
};

export default Products;
